import React from 'react'
import AppLoading from './layout/AppLoading';
import App from './App';

class Configs extends React.Component{
    constructor(){
        super()
        this.state = {
            isLoading: true
        }
    }

    componentDidMount(){
        console.log(this.state)
        this.setState({isLoading: false})
        console.log(this.state)
    }

    render(){
        if(this.state.isLoading === true){
            return <AppLoading></AppLoading>
        }

        return (
            <div className="page">
                <div className="page-header page-header-bordered">
                    <h1 className="page-title">Configure seu Negócio</h1>
                    <ol className="breadcrumb">
                        <li className="breadcrumb-item active">
                            Precisamos saber mais sobre seu negócio
                        </li>
                    </ol>
                </div>
                <div className="page-content container-fluid">
                    <p>{this.state.isLoading ? 'verdade' : 'mentira'}</p>
                </div>
            </div>
        )
    }
}

export default Configs
